const Telegraf = require('telegraf'); 

const bot = new Telegraf('123123123:AAABBBCCC123123123'); 

bot.sendMessage('123123123', { 
  text: 'Hello World!' 
});

This will send a "Hello World!" message to the user with ID 123123123. 

To send a reply to a specific message, get the message_id from that update and use: 

bot.sendMessage('123123123', { 
  text: 'Reply message', 
  reply_to_message_id: 456789 
}); 

The message_id should match the update_id of the original message.

